import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Register from '../components/register';
import LogIn from '../components/login';
import TopicList from '../components/topics';
import Start_New_Topic from '../components/start_new_topic';

const Content = ({setUser, user, logIn, history}) => {
    console.log(logIn.user_id)
    return (
        <main className="main">
            <Switch>
    <Route exact path='/' component={(props) => <> <Register setUser={setUser} {...props}/> <LogIn setUser={setUser} {...props} /> <TopicList logIn={logIn} history={history} /> </>} />
                <Route path='/topic-list' component={() => <> <TopicList logIn={logIn} history={history}/> <Start_New_Topic /> </>} />
            </Switch>
        </main>
    )
}

export default Content;
